import Icon from "../../../components/Icon/Icon";
import { GlobalThemes } from "../../../ThemeManager";
import "./SalesTheme.scss";
const SalesTheme = ({}: {}) => {
  return (
    <>
      <div className={"salesContainer " + GlobalThemes.Sales}>
        <div className="header">
          <Icon icon="SalesBackground" viewBox="0 0 500 250" />
          <div className="headline one">
            Sales <span className="blue">Theme</span>
          </div>
          <div className="headline one">Bringing you more sales</div>
        </div>
        <a className="designButton funButton">Fun Button</a>
        <a className="designButton gradientButton">Gradient Button</a>
      </div>
    </>
  );
};
export default SalesTheme;
